        if parameter in _request:
            connector_auth[parameter] = _request[parameter]


    hrflow_auth = dict()
    for parameter in ['api_secret', 'api_user']:
        if "{}{}".format(ORIGIN_SETTINGS_PREFIX, parameter) in settings:
            hrflow_auth[parameter] = settings["{}{}".format(ORIGIN_SETTINGS_PREFIX, parameter)]

        if parameter in _request:
            hrflow_auth[parameter] = _request[parameter]


    pull_parameters = dict()
