        if "{}{}".format(ORIGIN_SETTINGS_PREFIX, parameter) in settings:
            pull_parameters[parameter] = settings["{}{}".format(ORIGIN_SETTINGS_PREFIX, parameter)]

        if parameter in _request:
            pull_parameters[parameter] = _request[parameter]


    push_parameters = dict()
    for parameter in ['job_id', 'status_when_created', 'source']:
        if "{}{}".format(ORIGIN_SETTINGS_PREFIX, parameter) in settings:
            push_parameters[parameter] = settings["{}{}".format(ORIGIN_SETTINGS_PREFIX, parameter)]

        if parameter in _request:
            push_parameters[parameter] = _request[parameter]


    return Bullhorn.update_applications_in_hrflow(
        workflow_id=workflow_id,
        connector_auth=connector_auth,
        hrflow_auth=hrflow_auth,
        pull_parameters=pull_parameters,
        push_parameters=push_parameters,
